import React from 'react';
import { makeStyles, createStyles, Theme } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1
    },
    paper: {
      padding: theme.spacing(2),
      height: "100%",
      textAlign: "center",
      color: theme.palette.text.secondary,
      boxSizing: "border-box"
    },
    gridItem: {
      boxSizing: "border-box",
      padding: theme.spacing(1)
    },
    masonryItemFirst: {
      boxSizing: "border-box",
      padding: `0 ${theme.spacing(1)}px ${theme.spacing(1)}px ${theme.spacing(
        1
      )}px`,
      [theme.breakpoints.up("lg")]: {
        padding: `0px ${theme.spacing(1)}px 0px 0px`
      },
      [theme.breakpoints.down("sm")]: {
        padding: `0px ${theme.spacing(1)}px 0px 0px`
      }
    },
    masonryItemSecond: {
      boxSizing: "border-box",
      padding: `${theme.spacing(1)}px ${theme.spacing(1)}px 0px ${theme.spacing(
        1
      )}px`,
      [theme.breakpoints.up("lg")]: {
        padding: `0px 0px 0px ${theme.spacing(1)}px`
      },
      [theme.breakpoints.down("sm")]: {
        padding: `0px 0px 0px ${theme.spacing(1)}px`
      }
    }
  })
);


function App() {
  const classes = useStyles();
  return (
    <Grid container spacing={3} style={{ height: "100%" }}>
      <Grid item md={6} xs={12} className={`${classes.gridItem}`}>
        <Paper className={`${classes.paper}`}>Top/Left</Paper>
      </Grid>
      <Grid item container md={6} xs={12} className={classes.gridItem}>
        <Grid
          item
          lg={12}
          md={12}
          xs={12}
          className={`${classes.masonryItemFirst}`}
        >
          <Paper className={classes.paper}>Shared</Paper>
        </Grid>
        <Grid
          item
          lg={12}
          md={12}
          xs={12}
          className={`${classes.masonryItemSecond}`}
        >
          <Paper className={classes.paper}>Shared</Paper>
        </Grid>
        <Grid
          item
          lg={12}
          md={12}
          xs={12}
          className={`${classes.masonryItemSecond}`}
        >
          <Paper className={classes.paper}>Shared</Paper>
        </Grid>
        <Grid
          item
          lg={12}
          md={12}
          xs={12}
          className={`${classes.masonryItemSecond}`}
        >
          <Paper className={classes.paper}>Shared</Paper>
        </Grid>
      </Grid>
  </Grid>
  );
}

export default App;
